The building was designed by BC Arkitekter. Opened on the 26th of February 2008, it was established and is fully funded by the Norwegian government, with the responsibility for operations assigned to The Ministry of Agriculture and Food. The Ministry coordinates daily operation with the Nordic Gene Resource Centre and the Global Crop Diversity Trust, and receives guidance from a dedicated international council established to advise the Seed Vault.

Worldwide, more than 1,700 genebanks hold collections of food crops for safekeeping, yet many of these are vulnerable, exposed not only to natural catastrophes and war, but also to avoidable disasters, such as lack of funding or poor management. Something as mundane as a poorly functioning freezer can ruin an entire collection.

The more recent steel clad service building to the left, designed by Sn√∏hetta, was built last year to facilitate the process of registration and shipment of the seeds before they are placed securely in the halls of the seed vault.

